import React from 'react';
import { Row, Col, Form, FormGroup, Container } from 'reactstrap';

const newTour = () => {
  return <section>
    <Container>
        <Row>
            <Col lg="8" className="m-auto">
            </Col>
        </Row>
    </Container>
  </section>
}

export default newTour
